import { Table } from "react-bulma-components";
import axios from "../../utils/api";

function BookList() {
  const getBooks = async () => {
    try {
      const res = await axios.get("/books");
      console.log(res);
    } catch (e) {
      console.log(e);
    }
  };
  useEffect(() => {
    getBooks();
  }, []);

  return (
    <div>
      <Table>
        <thead>
          <tr>
            <th>Nome</th>
            <th>idade</th>
            <th>Vacinação</th>
          </tr>
        </thead>
      </Table>
    </div>
  );
}

export default BookList;
